import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-page">
      <div className="left-side">
        <h2>Welcome to Our Online Store</h2>
        <p>
          We are dedicated to providing high-quality products and exceptional customer service.
          Whether you are looking for the latest fashion trends, tech gadgets, or home essentials, we have it all.
          Shop with confidence and enjoy a seamless shopping experience with us.
        </p>
      </div>
      <div className="right-side">
        <h2>About Us</h2>
        <p>
          Our company was founded with a vision to bring convenience and affordability to your doorstep.
          With years of industry experience, we curate a wide range of products to cater to diverse tastes and preferences.
          Our team of experts ensures that every product meets our strict quality standards, so you can shop with peace of mind.
        </p>
        <a href="/register" className="cta-button">Join Us</a>
      </div>
    </div>
  );
};

export default HomePage;
